// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8.0;

import "./Permissions.sol";

contract Voter {
    Permissions permissions;

    constructor(address permissionsAddress) {
        permissions = Permissions(permissionsAddress);
    }

    enum VoterStatus { Unregistered, Registered, Verified }
    
    /*
        Voter Related Structures,
        VoterAddressInfo: Contains address related information of a voter.
        VoterPersonalInfo: Contains personal information of a voter.
        VoterContactInfo: Contains contact information of a voter.
        VoterInfo: Contains all the information of a voter.
        VoterAccount: Contains the address of a voter and its information.
    */

    struct VoterAddressInfo {
        string state;
        string district;
        string locality;
        string ward;
        string house_name;
        string house_number;
        string street;
        string pincode;
    }

    struct VoterPersonalInfo {
        string first_name;
        string middle_name;
        string last_name;
        string dob;
    }

    struct VoterContactInfo {
        string phone;
        string email;
    }

    struct VoterInfo {
        VoterPersonalInfo personal_info;
        VoterContactInfo contact_info;
        VoterAddressInfo permeant_address;
        VoterAddressInfo current_address;
        bool married;
        bool orphan;
    }

    struct VoterAccount {
        address payable voter_address;
        VoterInfo voter_info;
        VoterStatus status;
    }
    
    event VoterRegistered(address indexed voterAddress);
    event VoterVerified(address indexed voterAddress);
    
    mapping(address => VoterAccount) public father_linker;                     // voter account father account liker
    mapping(address => VoterAccount) public mother_linker;                     // voter account mother account liker
    mapping(address => VoterAccount) public spouse_linker;                     // voter account spouse account liker
    mapping(address => VoterAccount) public guardian_linker;                   // voter account guardian account liker

    mapping(address => VoterAccount) public voters;                            // list of voters

    
    function registerVoter(VoterInfo memory details) public {
        require(voters[msg.sender].status == VoterStatus.Unregistered, "User already registered.");
        voters[msg.sender] = VoterAccount(payable(msg.sender), details, VoterStatus.Registered);
        emit VoterRegistered(msg.sender);
    }

    function updateVoterStatus(address payable _voterAddress, VoterStatus _status) public {
        require(permissions.requireAdmin(Permissions.AdminRole.LocalityOfficer), "Only Locality Officer can update voter status.");
        voters[_voterAddress].status = _status;
        emit VoterVerified(_voterAddress);
    }
    
    // function is_admin(address _admin) public view returns (bool) {
    //     bool exists = bytes(admins[_admin].name).length > 0;
    //     return exists;
    // }
}
